import React from 'react';

function LeftSection({imageURL,productName,productDescription,tryDemo,learnMore,googlePlayLink,appStoreLink,appStore}) {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='col-6 p-3'>
                    <img src={imageURL} alt={productName} className='img-fluid mb-3' />
                </div>
                <div className='col-6 p-3'></div>
            </div>
        </div>
     );
}

export default LeftSection;
